	this.good.name = "good";
	this.good.setTransform(649.75,345.95,1,1,0,0,0,250.8,36.1);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.good},{t:this.bad}]}).wait(1));

	// 按钮
	this.jia_3 = new lib.加3();
	this.jia_3.name = "jia_3";
